import React, { useEffect, useState } from 'react';
import { getFilterList, getListCocktail } from '../hooks/api';

const Api = () => {

  const [dataList, setDataList] = useState([])

  useEffect(() => {
    (async function() {
      try {
        const {data } = await getFilterList();
        if (data && data.drinks) {
          setDataList(data.drinks);
        }
      } catch (e) {
        console.log(e);
      }
    })();
  }, [])

  return (
    <div>
        <div>
          <ul>
              {dataList.map(item => (<li key={item.strCategory}>{item.strCategory}</li>))}
          </ul>
        </div>
      </div>
  )
}

export {Api};
